import React from 'react'
import Content from './Content'

export default class Container extends React.Component {

    state = {
        randomMeal: [],
        sessionOrder: [],
        logged: false
    }

    logIn = () => {
        this.setState({logged: true})
    }

    render() {

        return (
            <Content key={"content"} login={this.logIn}/>

        )
    }

}
